function getAllRegions(): Region[] {
    return data['region']
}

function getTownsFromRegion(regionName: string): Town[] | undefined {
    if (regionName) {
        const region = data.region.find((region) => region.name === regionName);
        if (region) {
            const towns = data.town.filter((town) => town.region_id === region.id);
            return towns;
        }
    }
}

